import LandingPage from './ecommerce/Home';
import HeaderSection from './snippets/Header';
import FooterSection from './snippets/Footer';
import CopyWrite from './snippets/Copywrite';

function App() {
  return (
    <div>
      <HeaderSection />
      <LandingPage />
      <FooterSection />
      <CopyWrite />
    </div>
  );
}

export default App;
